import React, { Component } from 'react';

class CarMake extends Component {

  handleMakeClick = (e) => {
    e.preventDefault();
    console.log(e.target.value, 'was clicked');
  }

  render() {
    const { make } = this.props
    return (
      <div className="button-div" onClick={this.handleMakeClick}>
        <button className="make-button" value={make}>{make}</button>
      </div>
    );
  }

}

export default CarMake;
